import React from "react";
import "./Kontakt.css";
import KontaktForm from "./KontaktForm";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {faHouse} from "@fortawesome/free-solid-svg-icons";
export default function KontaktHandler() {
  return (
    <div>
      <div className="main">
      <iframe
        width="600"
        height="500"
        id="gmap_canvas"
        src="https://maps.google.com/maps?q=44-335%20Jastrz%C4%99bie%20Zdr%C3%B3j%20ul.%20Wielkopolska%201k&t=&z=13&ie=UTF8&iwloc=&output=embed"
        frameBorder="0"
        scrolling="no"
        marginHeight="0"
        marginWidth="0"
      ></iframe>
      </div>
      <div className="icotype">
      <FontAwesomeIcon icon={faBuilding} color="white" ontSize="30px"/>
      </div>
      <KontaktForm />
      </div>

  );
}
